import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { FaBars, FaTimes, FaShoppingCart, FaUser, FaBoxOpen, FaHome, FaSignOutAlt } from "react-icons/fa";
import "./Navbar.css";

export default function Navbar() {
  const [mobileOpen, setMobileOpen] = useState(false);
  const navigate = useNavigate();

  // Simple check if user is logged in (you can improve later)
  const user = localStorage.getItem("user") ? JSON.parse(localStorage.getItem("user")) : null;

  const handleLogout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("user");
    setMobileOpen(false);
    navigate("/login");
  };

  return (
    <>
      <nav className="navbar">
        <div className="navbar-container">
          {/* HAMBURGER ICON */}
          <div className="menu-toggle" onClick={() => setMobileOpen(!mobileOpen)}>
            {mobileOpen ? <FaTimes size={26} /> : <FaBars size={26} />}
          </div>

          {/* LOGO */}
          <Link to="/" className="navbar-logo" onClick={() => setMobileOpen(false)}>
            <span className="logo-text">Flowtoo</span>
          </Link>

          {/* DESKTOP ICONS */}
          <div className="navbar-icons desktop-only">
            {user && (
              <Link to="/myorders" className="nav-icon">
                <FaBoxOpen size={22} />
              </Link>
            )}
            {user ? (
              <div className="nav-icon" onClick={handleLogout}>
                <FaSignOutAlt size={22} />
              </div>
            ) : (
              <Link to="/login" className="nav-icon">
                <FaUser size={22} />
              </Link>
            )}
            <Link to="/cart" className="nav-icon">
              <FaShoppingCart size={24} />
            </Link>
          </div>
        </div>
      </nav>

      {/* MOBILE MENU â€” SLIDES IN */}
      <div className={`mobile-menu ${mobileOpen ? "open" : ""}`}>
        <div className="mobile-menu-content">
          <Link to="/" onClick={() => setMobileOpen(false)} className="mobile-link">
            <FaHome /> Home
          </Link>

          <Link to="/cart" onClick={() => setMobileOpen(false)} className="mobile-link">
            <FaShoppingCart /> Cart
          </Link>

          {user ? (
            <>
              <Link to="/myorders" onClick={() => setMobileOpen(false)} className="mobile-link">
                <FaBoxOpen /> My Orders
              </Link>
              <div className="mobile-link logout" onClick={handleLogout}>
                <FaSignOutAlt /> Logout
              </div>
            </>
          ) : (
            <>
              <Link to="/login" onClick={() => setMobileOpen(false)} className="mobile-link">
                <FaUser /> Login
              </Link>
              <Link to="/register" onClick={() => setMobileOpen(false)} className="mobile-link">
                Register
              </Link>
            </>
          )}
        </div>
      </div>

      {/* OVERLAY WHEN MOBILE MENU OPEN */}
      {mobileOpen && <div className="mobile-overlay" onClick={() => setMobileOpen(false)}></div>}
    </>
  );
}
